                0x07748bc6877c9b82c8b98666ee9d0626ec7f5be4205f79ee8528ef1c4a376fc7,
            ];
            assert_eq(
                expected,
                poseidon::bn254::perm::x5_5(state),
                "Failed to reproduce output for [0, 1, 2, 3, 4]",
